        "vaeua-gui-eua.sas.van.Insights.outliers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">В <span class\\="xis-windowItem">Выбросы</span> Insight определяет элементы данных в вашем отчете, на которые могут повлиять выбросы. </p><p class\\="xis-paragraph">Чтобы просмотреть анализ выбросов для показателя, щелкните <span data-icon-name\\="information" alt\\="значок информации" aria-label\\="значок информации"></span> рядом с мерой, а затем щелкните <span class\\="xis-windowItem">Просмотр анализа выбросов</span> во всплывающем окне.</p><p class\\="xis-paragraph">Чтобы просмотреть влияние выбросов на объекты в отчете, щелкните <span class\\="xis-windowItem">Анализируйте объекты на предмет воздействия</span>. Когда анализ будет завершен, щелкните <span class\\="xis-windowItem">Детали</span> рядом с именем объекта, чтобы просмотреть подробный анализ выбросов в этом объекте.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Примечание\\:</span>В <span class\\="xis-windowItem">Выбросы</span> Insight идентифицирует все выбросы в ваших источниках данных, даже если объекты отчета исключают значения с помощью фильтров или ранжирования.</div></section>',
