        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.reusePredictors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Разрешает использовать предиктор несколько раз в правилах разделения узла нижнего уровня. Если не выбрано, предиктор может появляться только один раз в кумулятивных правилах разделения узла нижнего уровня.</p></section>',
        "vaeua-gui-eua.Properties.assessment.showAllPlots.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Отображает все доступные графики оценки, включая матрицу ошибок, кривую ROC, подъем и ошибочную классификацию.</p></section>',
