        "vaeua-gui-eua.Properties.svm.missingvalue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Расширяет модель, включая в нее наблюдения с отсутствующими значениями. Для предикторов категорий отсутствующему значению назначается собственный уровень измерения. Для предикторов показателей отсутствующему значению присваивается наблюдаемое среднее.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.maximumSeconds.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Использует максимальное число итераций по умолчанию для обучения нейронной сети. Значение по умолчанию\\: 270. </p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.resolution.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.missingAssignment.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.analyzeSentiment.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Анализирует тональность каждого документа на основе терминов с положительным и отрицательным значением.</p></section>',
