        "vaeua-gui-eua.Properties.neuralnetwork.missingvalue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Расширяет модель, включая в нее наблюдения с отсутствующими значениями. Для предикторов категорий отсутствующему значению назначается собственный уровень измерения. Для предикторов показателей отсутствующему значению присваивается наблюдаемое среднее.</p></section>',
        "vaeua-gui-eua.Properties.svm.defaulttolerance.help.tip.txt": "Дополнительная информация об этом параметре ",
