        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.factMac.nonnegativeFactorization.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Принудительно применяет неотрицательные факторы в случае установки нулевой составляющей смещения. Это может повысить эффективность, если данные для обучения очень немногочисленны.</p></section>',
