        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Определяет уровень пользовательской настройки, которую пользователь может выполнить для своего представления отчета. Каждый уровень включает все более низкие уровни.</p></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Генерирует пользовательские теги HTML, чтобы объект или отчет можно было встроить в веб-страницу.</p><p class\\="xis-paragraph">Чтобы включить пользовательские теги на веб-странице, также необходимо добавить теги &lt;script&gt; к заголовку страницы. Подробнее о встраиваемом содержимом SAS Visual Analytics см. <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">документацию SAS Visual Analytics SDK</a>.</p></section>',
        "vaeua-gui-eua.AutoCustomCategoryPanel.categoryType.help.content.txt.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Тип группы <span class\\="xis-windowItem">Уникальные значения</span> доступен только для показателей, имеющих более низкое число уникальных значений.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.responseBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Задает число сегментов для категоризации отклика показателя.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.cellWeight.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruneWithValidationData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Создает дерево решений с помощью обучающих данных и очищает дерево решений с помощью алгоритма сложности затрат, применяемого к данным проверки.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.generalizedAdditive.modelEvaluationCriterion.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Задает критерий выбора коэффициента сглаживания для эффектов сплайна.</p></section>',
        "vaeua-gui-eua.Properties.assessment.useDefaultNumberOfBins.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.bayesNet.chooseBestNumParents.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Построение указанных структур сети, выполнение итеративного обхода числа родительских элементов, начиная с 1 и до значения максимального числа родительских элементов. Выбирается сеть с наилучшей долей ошибочных классификаций.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.binMethod.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.table.detailData.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.predAuto.sensitivityToExtremeValues.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Определяет степень чувствительности, используемую для выявления экстремумов. Обычно при более высоких значениях чувствительности больше значений определяются как экстремумы.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Задает автоматический пропуск экрана входа в систему и использование гостевых учетных данных. Для пользователей с гостевыми учетными данными состояние просмотра не сохраняется между сеансами. Кроме того, для них недоступны настройки пользователя.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.maxLevels.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Определение максимальной глубины дерева, где корневой узел является первым уровнем.</p></section>',
        "vaeua-gui-eua.Properties.linearRegression.variableSelection.maximumEffects.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
