        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Выберите переменную, с помощью которой будет разделено дерево. Переменные сортируются по значению Logworth, которое показывает, в какой степени переменная делит данные. Logworth является отрицательным логарифмом пи-величины из критерия хи-квадрат.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.scatterplot.overviewAxisCannotBeShown.multipleMeasurePairs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Отображает обзор оси.</p><p class\\="xis-paragraph">Этот параметр недоступен, если графику назначено более двух элементов данных.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.networkStructure.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.predAuto.numGroups.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Указывает число групп, отображаемое в результатах. По умолчанию отображаются три наибольших и три наименьших группы.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.includePartsOfSpeech.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
