        "vaeua-gui-eua.Properties.predAuto.sensitivityToExtremeValues.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.svm.defaultiteration.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Использует максимальное число итераций по умолчанию, когда процесс подгонки модели должен остановиться. Значение по умолчанию\\: 25.</p></section>',
        "vaeua-gui-eua.Properties.svm.defaulttolerance.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Использует минимальный абсолютный допуск по умолчанию, на котором итерация останавливается. Значение по умолчанию\\: 1,0E-6.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Удалите элементы управления из области запроса страницы, чтобы исключить следующую проблему. Например, чтобы исключить проблемы со средним приоритетом, сократите число элементов управления в области запроса страницы до 10 или менее.</p><p class\\="xis-paragraph">Средний приоритет\\: содержит &gt; 10 объектов в области запроса страницы.</p></section>',
        "vaeua-gui-eua.Properties.svm.customPenaltyValue.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.neuralnetwork.annealingRate.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Используются только предикторы, зависимые от переменной отклика в указанной статистике тестирования независимости.</p></section>',
        "vaeua-gui-eua.LinkFunction.label.help.tip.txt": "Дополнительная информация об этом параметре ",
