        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.color.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Присваивает кластерам цвет в зависимости от значений данных в кластере. Этот параметр доступен, только если назначена роль данных <span class\\="xis-windowItem">Цвет</span>.</p></section>',
        "vaeua-gui-eua.partitions.useUniqueID.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.predAuto.showSubgroups.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.missingAssignment.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.ReportReview.LowPercentageUsedColumns.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.neuralnetwork.l2.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Задает параметр регуляризации L2. Ненулевое значение позволяет выделить наиболее значимые предикторы.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useStopList.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.ridge.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Задает параметр регуляризации L2. Ненулевое значение позволяет выделить наиболее значимые предикторы.</p></section>',
        "vaeua-gui-eua.Properties.generalizedAdditive.gConvValue.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.lasso.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.neuralnetwork.allowNeuronDirectConnect.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.ReportReview.HighCalculationCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Удалите вычисления, чтобы исключить следующую проблему. Например, чтобы исключить проблемы с низким приоритетом, сократите число вычислений в отчете до 14 или менее.</p><p class\\="xis-paragraph">Низкий приоритет\\: содержит &gt;\\= 15 вычислений</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.linkType.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.partialdependence.numObs.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.generalizedAdditive.maxDf2d.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Задает максимальное число степеней свободы для всех двумерных эффектов сплайна.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.variableSelection.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Тестирование каждого предиктора на условную независимость переменной отклика для любого другого предиктора в указанной статистике тестирования независимости. Выбор параметра <span class\\="xis-windowItem">Выбор переменных</span> отклоняет предикторы, условно независимые от переменной отклика, если имеется любой другой предиктор.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.leafSize.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.assessment.cutoff.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Задает вероятность отсечения, которая определяет, является ли наблюдение смоделированным событием.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Скорректируйте формат отчета, чтобы не использовать в нем вложенные контейнеры. Это позволит исключить следующие проблемы. Например, чтобы исключить проблемы с высоким приоритетом, убедитесь, что в формат отчета включено 6 или менее вложенных контейнеров.</p><p class\\="xis-paragraph">Низкий приоритет\\: содержит &gt; 2 вложенных контейнеров</p><p class\\="xis-paragraph">Средний приоритет\\: содержит &gt; 4 вложенных контейнеров</p><p class\\="xis-paragraph">Высокий приоритет\\: содержит &gt; 6 вложенных контейнеров</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
