        "vaeua-gui-eua.properties.sankey.linkColor.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.maxBranches.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.bootstrap.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.Options.alternativeText.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.linearRegression.variableSelectionType.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Задает метод определения наилучшего набора эффектов модели из тех, что были присвоены на панели ролей.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.annealingRate.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Задает показатель для метода имитации отжига для оптимизации SGD. Ненулевое значение обеспечивает сходимость модели рядом с локальным минимумом целевой функции.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Параметр указывает, будут ли термины классифицированы по частям речи и будут ли распознаваться существительные и другие текстовые элементы.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.optimization.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
