        "vaeua-gui-eua.Properties.predAuto.showSubgroups.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Указывает, следует ли вычислять группы и отображать три наибольших и три наименьших группы в результатах. Для указанных переменных отклика выполняется несколько деревьев принятия решения, и каждая группа описывает листовой элемент в одном из этих деревьев принятия решения.</p></section>',
