        "vaeua-gui-eua.Properties.neuralnetwork.l1.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Задает параметр регуляризации L1. Ненулевое значение может привести к отбрасыванию незначимых предикторов из модели.</p></section>',
