        "vaeua-gui-eua.Properties.neuralnetwork.distributionlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Задает функцию распределения для моделирования отклика показателя.</p></section>',
        "vaeua-gui-eua.LinkFunction.label.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
