        "vaeua-gui-eua.CalculatedItemUIMediator.scopes.scopedAggregation.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.slider.setFixedRange.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Позволяет указать <span class\\="xis-windowItem">минимальное</span> и <span class\\="xis-windowItem">максимальное</span> значение для конечных точек ползунка.</p><div class\\="xis-paragraph">Этот параметр недоступен, если справедливо любое из следующих утверждений\\: <div class\\="xis-listUnordered"><ul><li class\\="xis-item">для ползунка определен фильтр или ранг</li><li class\\="xis-item">для ползунка указан динамический минимум или максимум</li><li class\\="xis-item">ползунок является целью действия фильтрации</li></ul></div></div><div class\\="xis-note"><span class\\="xis-noteGenText">Примечание\\:</span>Если ползунку присвоен параметр или же если активирован параметр <span class\\="xis-windowItem">Действовать на основе агрегированных данных в фильтрованных объектах</span>, то этот параметр всегда активен.</div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.ReportReview.HighPageCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Удалите страницы, чтобы исключить следующие проблемы. Например, чтобы исключить проблемы со средним приоритетом, сократите число страниц в отчете до 12 или менее.</p><p class\\="xis-paragraph">Низкий приоритет\\: в отчете &gt; 6 страниц</p><p class\\="xis-paragraph">Средний приоритет\\: в отчете &gt; 12 страниц</p></section>',
        "vaeua-gui-eua.Properties.assessment.cutoff.help.tip.txt": "Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.sas.van.Insights.outliers.help.tip.txt": "Дополнительная информация о статистике",
        "vaeua-gui-eua.Properties.predAuto.showGroups.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Указывает, все ли группы описываются в результатах. По умолчанию описываются только три наибольших и три наименьших группы. Если этот параметр выбран, то на вкладках <span class\\="xis-windowItem">Наибольшие</span> и <span class\\="xis-windowItem">Наименьшие</span> отображаются все группы, но с разной сортировкой. Для откликов показателей группы на вкладке <span class\\="xis-windowItem">Наибольшие</span> сортируются по убыванию среднего значения, а на вкладке <span class\\="xis-windowItem">Наименьшие</span> — по возрастанию. Для откликов категорий группы на вкладке <span class\\="xis-windowItem">Наибольшие</span> сортируются по убыванию процента выбранного уровня события, а на вкладке <span class\\="xis-windowItem">Наименьшие</span> — по возрастанию.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
        "vaeua-gui-eua.Properties.linearRegression.variableSelectionCriterion.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Задает критерий ранжирования эффектов для учета в процессе выбора. Используется для выбора финальной модели.</p></section>',
        "vaeua-gui-eua.Properties.svm.kernellabel.help.aria.txt": "Справка. Дополнительная информация об этом параметре ",
